import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Playlists from '../Pages/Playlists';

const AppRoutes: React.FC = () => (
    <Switch>
        <Route path="/" exact component={Playlists} />
    </Switch>
);

export default AppRoutes;
